import * as React from 'react';
import { IPokerHomepageContainerProps, IPokerHomepageContainerState } from '../../shared';

export class PokerHomepageContainer extends React.Component<IPokerHomepageContainerProps, IPokerHomepageContainerState> {
	constructor(props: IPokerHomepageContainerState) {
    super(props);
    this.state = {value: ''};

    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  private handleChange = (event: React.ChangeEvent<HTMLInputElement>): void => {
    this.setState({value: event.target.value});
  }

  private handleSubmit = (event: React.ChangeEvent<HTMLInputElement>): void => {
    alert('A name was submitted: ' + this.state.value);
    event.preventDefault();
  }

	render(): JSX.Element {
		return(
			<div>
				<div>Please enter your details</div>
				<div>
					<form onSubmit={this.handleSubmit}>
					<label>
						<div>
							Name: <input type="text" onChange={this.handleChange} />
						</div>
						<div>
							User ID: <input type="text" />
						</div>
					</label>
					<input type="submit" value="Submit" />
					</form>
				</div>
			</div>
		);
	}
}
